import React from 'react'

const Login = () => {

    return (
        <>
            <h1>Welcome to login Form</h1>
            <form>
                <input type='text' id='name' className='form-control-lg' /><br/><br/>
                <input type='text' id='number' className='form-control-lg' /><br/><br/>
                <button className='btn btn-outline-info'>Submit</button>
            </form>

        </>
    )
}

export default Login;
